-- Records of tbl_faqs
-- ----------------------------
INSERT INTO `tbl_faqs` VALUES (9, 'What Is Monet?', 'Monet is a cryptocurrency solution to help monetize content creators. Our solution aims to act as an impartial intermediary between content creators and businesses seeking affiliate sponsorships.');
INSERT INTO `tbl_faqs` VALUES (10, 'How is Monet different from other advertisement solutions?​​', 'Monet does not keep records of any content creators who aim to use our advertising platform. This anonymous system alleviates concerns for content creators of being demonetized. Monet also gives content creators free reign to not only advertise what they want without a formal contract, but allows them complete freedom on how they advertise for other businesses.');
INSERT INTO `tbl_faqs` VALUES (11, 'How do content creators earn with Monet?', 'Creators will be able to generate specialized links to certain products by tying their crypto wallet addresses to the platform. They then may share this link on their own platforms. Once clicked by any individual, Monet will reward it\'s proprietary token (MTZ) to the creator of this link. For every advertisement available, a fixed rate of per-click rewards will be available based on a total token supply of the app\'s pool. These per-click rewards can be increased by boosting.');
INSERT INTO `tbl_faqs` VALUES (12, 'What is Boosting?', 'Boosting is an available option to all holders of MTZ to increase the amount of per-click rewards generated by advertisements. When the per-click rewards are increased on an advertisement, it will create more incentive for creators to advertise that product.');
INSERT INTO `tbl_faqs` VALUES (13, 'What is an \"M-Link?\"', 'An \"M-Link\" is a specialized link that will reward tokens to whomever generated the link. An M-Link is a unique URL generated using a crypto wallet address and navigates a user to the business product page from the selected advertisement on Monet\'s platform.');
INSERT INTO `tbl_faqs` VALUES (14, 'How do businesses benefit?', 'Businesses no longer have to worry about the free speech of affiliates, freeing their businesses from HR-related concerns. This also gives businesses a <b>free</b> advertising solution, with options to increase their advertising potential through boosting.');
INSERT INTO `tbl_faqs` VALUES (15, 'Can Businesses boost their own ads?', 'Yes. There are no plans to restrict this feature to only individual MTZ holders.');
INSERT INTO `tbl_faqs` VALUES (16, 'Couldn\'t businesses boosting their own ads create an imbalance for smaller businesses?', 'Boosting will require a fee. This fee increases exponentially based on the total amount of MTZ that is boosted into an AD. While staking rewards will also increase, the rate of increase will become increasingly slower as there is more MTZ boosted into each ad. This will prevent any one advertisement from completely dominating the platform.<br/>\r\n○&nbsp;&nbsp;&nbsp;We also plan on running special bonuses for new businesses who sign onto Monet.');
INSERT INTO `tbl_faqs` VALUES (17, 'Why would I, as a holder of MTZ, boost an ad?', 'Boosting also rewards holders interest. The more MTZ boosted into an ad, the more interest will be rewarded to the holders. Each ad will have their own APY rewards based on the amount of MTZ staked into each ad. \r\nYou also get to exercise the power of \"Word of Mouth\" so you can help businesses and products you deeply believe in!');
INSERT INTO `tbl_faqs` VALUES (18, 'How does Monet prevent bots from exploiting the click-reward generation of M-Links?', 'Our current solution is to use Captcha as a tool to prevent bots. We will be extensively testing this as well as other solutions before the launch of the Advertisement Platform.');
INSERT INTO `tbl_faqs` VALUES (19, 'How does Monet maintain it\'s pool to continually reward tokens?', 'Monet will use fees to maintain it\'s pool. These fees will come from Boosting, as well as any crypto transfer. The transaction fees will be adjustable, but may never exceed 6%');
INSERT INTO `tbl_faqs` VALUES (20, 'What are the token details for Monet?', '<b>Symbol</b> - MTZ​<br/>\r\n○&nbsp;&nbsp;&nbsp;<b>Network</b> - Binance Smart Chain (BNC)<br/>\r\n○&nbsp;&nbsp;&nbsp;<b>Total Supply</b> - 17 Billion<br/>\r\n○&nbsp;&nbsp;&nbsp;<b>Liquidity Pool</b> - 9.35 Billion<br/>\r\n○&nbsp;&nbsp;&nbsp;<b>Max Supply</b> - 21 Billion<br/>\r\n○&nbsp;&nbsp;&nbsp;<b>Decimals</b> - 18<br/>\r\n○&nbsp;&nbsp;&nbsp;Please review the whitepaper for more details');
INSERT INTO `tbl_faqs` VALUES (21, 'When will the Monet Advertising Platform launch?​', 'Our small team first needs to acquire more funding, which we plan on doing via private pre-sale as well as our ICO. Once we acquire more funds, we will be able to expand our team, acquire a talented project manager, and then map out a cohesive timeline.');

